      },
      viewmax: {
        flexDirection: 'row', 
        paddingHorizontal: 0,
        marginTop: 0,
        backgroundColor: '#B1D3C1',
        height:60
      },
      views: {
        flexDirection: 'row', 
        paddingHorizontal: 1,
        marginTop: -13,
        marginLeft: 18
      },
      vieww: {
        flexDirection: 'row', 
